import React from 'react'

export default function toDonesContainer() {

    const ToDones=[
        {id:1, text:"Coding practice",done:true},
        {id:2, text:"Exercises",done:true},
        {id:3, text:"research on project",done:true},
        {id:4, text:"work on project",done:true},
    ]

    return (
        <div className="todones-container">
            <h3>BACKLOG</h3>
            {ToDones.map(todone=>{
                return(
                    <div className="todone=item" key={todone.id}>
                        <p>{todone.text}</p>
                        <div className="actions">
                            <button className="btn">&#8635; </button>
                        </div>
                    </div>
                )
            })}
        </div>
    )
}
